sourcesContent:
@tailwind base;
@tailwind components;
@layer components {
  /* button */
  .btn {
    @apply px-4 py-2 rounded-md border inline-flex appearance-none justify-center items-center gap-2 font-semibold transition duration-300
    focus:ring focus:ring-offset-1 focus:ring-opacity-50 focus:outline-none;
  }

  .btn-default {
    @apply border-gray-500 text-gray-700 bg-white hover:bg-gray-700 hover:border-gray-700 hover:text-white;
  }

  .btn-primary {
    @apply bg-primary-500 border-primary-500 text-white hover:bg-primary-700 hover:border-primary-700 hover:text-white
    focus:ring-primary-300;
  }

  .btn-secondary {
    @apply bg-secondary-500 border-secondary-500 text-white hover:bg-secondary-700 hover:border-secondary-700 hover:text-white
    focus:ring-secondary-300;
  }

  .btn-info {
    @apply bg-info-500 border-info-500 text-white hover:bg-info-700 hover:border-info-700 hover:text-white
  focus:ring-info-300;
  }

  .btn-warning {
    @apply bg-warning-500 border-warning-500 text-white hover:bg-warning-700 hover:border-warning-700 hover:text-white
    focus:ring-warning-300;
  }

  .btn-success {
    @apply bg-success-500 border-success-500 text-white hover:bg-success-700 hover:border-success-700 hover:text-white
    focus:ring-success-300;
  }

  .btn-error {
    @apply bg-error-500 border-error-500 text-white hover:bg-error-700 hover:border-error-700 hover:text-white
    focus:ring-error-300;
  }

  .btn-dark {
    @apply bg-gray-800 border-gray-800 text-white hover:bg-gray-900 hover:border-gray-900 hover:text-white
    focus:ring-gray-300;
  }

  .btn-rounded {
    @apply rounded-full;
  }

  .btn-outlined {
    @apply bg-transparent;
  }

  .btn-outlined.btn-default {
    @apply border-gray-500 text-gray-700 hover:bg-gray-700 hover:border-gray-700 hover:text-white;
  }

  .btn-outlined.btn-primary {
    @apply border-primary-500 text-primary-500 hover:bg-primary-700 hover:border-primary-700 hover:text-white;
  }

  .btn-outlined.btn-secondary {
    @apply border-secondary-500 text-secondary-500 hover:bg-secondary-700 hover:border-secondary-700 hover:text-white;
  }

  .btn-outlined.btn-info {
    @apply border-info-500 text-info-500 hover:bg-info-700 hover:border-info-700 hover:text-white;
  }

  .btn-outlined.btn-warning {
    @apply border-warning-500 text-warning-500 hover:bg-warning-700 hover:border-warning-700 hover:text-white;
  }

  .btn-outlined.btn-success {
    @apply border-success-500 text-success-500 hover:bg-success-700 hover:border-success-700 hover:text-white;
  }

  .btn-outlined.btn-error {
    @apply border-error-500 text-error-500 hover:bg-error-700 hover:border-error-700 hover:text-white;
  }

  .btn-outlined.btn-dark {
    @apply border-gray-800 text-gray-800 hover:bg-gray-900 hover:border-gray-900 hover:text-white;
  }

  .btn-text {
    @apply bg-transparent border-none hover:bg-transparent;
  }

  .btn-text.btn-default {
    @apply text-gray-700 hover:text-gray-700;
  }

  .btn-text.btn-primary {
    @apply text-primary-500 hover:text-primary-700;
  }

  .btn-text.btn-secondary {
    @apply text-secondary-500 hover:text-secondary-700;
  }

  .btn-text.btn-info {
    @apply text-info-500 hover:text-info-700;
  }

  .btn-text.btn-warning {
    @apply text-warning-500 hover:text-warning-700;
  }

  .btn-text.btn-success {
    @apply text-success-500 hover:text-success-700;
  }

  .btn-text.btn-error {
    @apply text-error-500 hover:text-error-700;
  }

  .btn-text.btn-dark {
    @apply text-gray-800 hover:text-gray-900;
  }

  .btn-sm {
    @apply text-sm px-2 py-1;
  }

  .btn-lg {
    @apply text-lg px-6 py-3;
  }

  .btn-block {
    @apply w-full;
  }

  .btn-icon {
    @apply px-1 w-[42px] h-[42px] rounded-full;
  }

  .btn-icon.btn-sm {
    @apply w-[30px] h-[30px];
  }

  .btn-icon.btn-lg {
    @apply w-[54px] h-[54px];
  }

  .btn-link {
    @apply p-0;
  }

  /* disabled */
  .btn:disabled,
  .btn.disabled {
    @apply cursor-not-allowed text-gray-400 bg-gray-200 border-gray-200
        hover:bg-gray-200 hover:text-gray-400 hover:border-gray-200;
  }
  .btn.btn-outlined:disabled,
  .btn.btn-outlined.disabled {
    @apply cursor-not-allowed text-gray-400 bg-transparent border-gray-200
        hover:bg-transparent hover:text-gray-400 hover:border-gray-200;
  }
  .btn.btn-text:disabled,
  .btn.btn-text.disabled {
    @apply cursor-not-allowed text-gray-400 bg-transparent border-transparent
        hover:bg-transparent hover:text-gray-400 hover:border-transparent;
  }
  .btn.btn-link:disabled,
  .btn.btn-link.disabled {
    @apply cursor-not-allowed text-gray-400 bg-transparent border-transparent
        hover:bg-transparent hover:text-gray-400 hover:border-transparent;
  }
}
@layer components {
  /* card */
  .card {
    @apply rounded-md shadow flex flex-col bg-white;
  }

  .card-header {
    @apply px-4 pt-3 font-semibold flex text-gray-800 items-center;
  }

  .card-body {
    @apply px-4 py-3 flex flex-col text-gray-700 flex-grow;
  }

  .card-footer {
    @apply px-4 pb-3 flex flex-row gap-2 items-center;
  }

  .card-bordered {
    @apply border shadow-none;
  }

  .card-bordered > .card-header {
    @apply pb-3 border-b;
  }

  .card-bordered > .card-footer {
    @apply pt-3 border-t;
  }
}
@layer components {
  /* forms */
  .form-inline .form-group {
    @apply flex-row items-start;
  }

  .form-group {
    @apply flex gap-2 flex-col items-start mb-5 last-of-type:mb-0;
  }

  .form-group-inline {
    @apply flex-row;
  }

  .form-label {
    @apply flex w-full;
  }

  .form-control,
  .form-select,
  .form-input {
    @apply flex w-full border-gray-300 rounded-md transition duration-300 focus:border-blue-500 focus:ring focus:ring-blue-500 focus:ring-opacity-50;
  }

  .form-input-error,
  .has-error {
    @apply border-error-500 focus:border-error-500 focus:ring-error-500 focus:ring-opacity-50 placeholder:text-error-700;
  }

  input[type='checkbox'] {
    @apply text-primary-500 rounded;
  }

  input[type='radio'] {
    @apply text-primary-500;
  }
}
@layer components {
  /* alerts */
  .alert {
    @apply px-4 py-3 rounded-md border flex gap-4 items-center;
  }

  .alert-dense {
    @apply px-3 py-2;
  }

  /* variants */
  .alert-default {
    @apply bg-gray-500 border-gray-500 text-white;
  }

  .alert-primary {
    @apply bg-primary-500 border-primary-500 text-white;
  }

  .alert-secondary {
    @apply bg-secondary-500 border-secondary-500 text-white;
  }

  .alert-info {
    @apply bg-info-500 border-info-500 text-white;
  }

  .alert-warning {
    @apply bg-warning-500 border-warning-500 text-white;
  }

  .alert-success {
    @apply bg-success-500 border-success-500 text-white;
  }

  .alert-error {
    @apply bg-error-500 border-error-500 text-white;
  }

  /* outlined */
  .alert-outlined {
    @apply bg-transparent;
  }

  .alert-outlined.alert-default {
    @apply bg-transparent border-gray-500 text-gray-500;
  }

  .alert-outlined.alert-primary {
    @apply bg-transparent border-primary-500 text-primary-500;
  }

  .alert-outlined.alert-secondary {
    @apply bg-transparent border-secondary-500 text-secondary-500;
  }

  .alert-outlined.alert-info {
    @apply bg-transparent border-info-500 text-info-500;
  }

  .alert-outlined.alert-warning {
    @apply bg-transparent border-warning-500 text-warning-500;
  }

  .alert-outlined.alert-success {
    @apply bg-transparent border-success-500 text-success-500;
  }

  .alert-outlined.alert-error {
    @apply bg-transparent border-error-500 text-error-500;
  }

  .alert-border {
    @apply bg-transparent !important;
  }
}
@layer components {
  .list-group {
    @apply rounded-md mb-4 list-none;
  }

  .list-header {
    @apply text-gray-500 flex gap-1 items-center;
  }

  .list-group-item-header {
    @apply bg-gray-100 px-2 py-1.5 text-sm border-b text-gray-500 font-semibold;
  }

  /* list small variant */
  .list-group.list-group-sm .list-group-item {
    @apply text-sm;
  }

  /* list inline variant */
  .list-group.list-inline .list-group-item {
    @apply inline-flex w-auto;
  }

  /* list tree variant */
  .list-group.list-tree {
    @apply border-l rounded-none px-2;
  }

  /* list item */
  .list-group-item {
    @apply list-none appearance-none transition duration-300 flex items-center w-full px-3 py-2 rounded-md text-gray-700;
  }

  /* list item state */

  .list-group-item:not(:disabled),
  .list-group-item:not(.disabled),
  .list-group-item:not(.active) {
    @apply hover:text-gray-800;
  }

  .list-group-item:disabled,
  .list-group-item.disabled,
  .list-group-item.list-group-item-disabled {
    @apply text-gray-400 cursor-not-allowed hover:bg-transparent hover:text-gray-400;
  }

  .list-group-item.active,
  .list-group-item.list-group-item-active {
    @apply bg-primary-500 text-white hover:!bg-primary-600 hover:!text-white;
  }

  /* color variants */
  .list-group-item-primary,
  .list-group-item.primary {
    @apply text-white bg-primary-500 border-primary-500 hover:bg-primary-600 hover:border-primary-500 hover:text-white;
  }

  .list-group-item-secondary,
  .list-group-item.secondary {
    @apply text-white bg-secondary-500 border-secondary-500 hover:bg-secondary-600 hover:border-secondary-500 hover:text-white;
  }

  .list-group-item-info,
  .list-group-item.info {
    @apply text-white bg-info-500 border-info-500 hover:bg-info-600 hover:border-info-500 hover:text-white;
  }

  .list-group-item-warning,
  .list-group-item.warning {
    @apply text-white bg-warning-500 border-warning-500 hover:bg-warning-600 hover:border-warning-500 hover:text-white;
  }

  .list-group-item-success,
  .list-group-item.success {
    @apply text-white bg-success-500 border-success-500 hover:bg-success-600 hover:border-success-500 hover:text-white;
  }

  .list-group-item-error,
  .list-group-item.error {
    @apply text-white bg-error-500 border-error-500 hover:bg-error-600 hover:border-error-500 hover:text-white;
  }

  a.list-group-item {
    @apply hover:text-gray-800 no-underline hover:no-underline;
  }

  .list-hover .list-group-item:not(:disabled):hover,
  .list-hover .list-group-item:not(.active):hover,
  .list-hover .list-group-item:not(.list-group-item-active):hover,
  .list-hover .list-group-item:not(.list-group-item-disabled):hover,
  .list-hover .list-group-item:not(.disabled):hover {
    @apply bg-gray-100;
  }

  /* bordered */
  .list-bordered {
    @apply border;
  }

  .list-bordered .list-group-item {
    @apply rounded-none;
  }

  .list-bordered .list-group-item:first-of-type {
    @apply rounded-t-md;
  }

  .list-bordered .list-group-item:last-of-type {
    @apply rounded-b-md;
  }

  .list-bordered .list-group-item:not(:last-of-type) {
    @apply border-b;
  }

  /* flush */
  .list-flush {
    @apply border-transparent;
  }

  .list-flush .list-group-item {
    @apply rounded-none;
  }

  .list-flush .list-group-item:not(:last-of-type) {
    @apply border-b;
  }

  /* text */
  .list-text .list-group-item {
    @apply px-2 py-1;
  }

  /* size */
  .list-dense .list-group-item {
    @apply px-2 py-1;
  }

  /* media content */
  .list-group-item-media {
  }

  .list-group-item-content {
    @apply flex flex-col flex-grow;
  }

  .list-group-item-title {
    @apply font-semibold;
  }

  .list-group-item-subtitle {
    @apply text-gray-600 text-sm;
  }

  .list-group-item-body {
    @apply text-gray-800;
  }

  .list-group-item-subheader {
    @apply text-xs font-normal text-gray-400;
  }

  .list-group-item-action {
    @apply flex gap-2 items-center;
  }

  .list-footer {
    @apply px-4 py-2;
  }

  .list-group-item-icon {
    @apply w-6;
  }

  .list-child {
    @apply mb-0;
  }
}
@layer components {
  .timeline-item {
    @apply flex gap-3 relative;
  }

  .timeline-number {
    @apply w-6 h-6 text-xs rounded-full flex items-center justify-center text-white bg-primary-500;
  }

  .timeline-line {
    @apply border-l border-gray-200 absolute left-3 top-6 h-full;
  }

  .timeline-title {
    @apply font-bold text-sm;
  }
}
@layer components {
  /* nav */
  .nav {
    @apply flex gap-2;
  }

  .nav-center {
    @apply justify-center;
  }

  .nav-right {
    @apply justify-end;
  }

  .nav-vertical {
    @apply flex-col;
  }

  .nav-vertical .nav-item {
    @apply py-2;
  }

  .nav-left .nav-item {
    @apply justify-start;
  }

  .nav-item {
    @apply flex justify-center items-center px-4 py-2 no-underline hover:no-underline
    text-gray-600 hover:text-primary-500 whitespace-nowrap;
  }

  .nav-item.disabled,
  .nav-item:disabled {
    @apply cursor-not-allowed text-gray-400 hover:text-gray-400;
  }

  .nav-item.active {
    @apply font-semibold text-primary-500;
  }

  .nav-fill {
    @apply justify-items-stretch;
  }

  .nav-fill .nav-item {
    @apply w-full;
  }

  /* tabs */
  .nav-tabs {
    @apply border-b;
  }

  .nav-tabs .nav-item {
    @apply -mb-[1px] border border-transparent text-gray-600 hover:text-gray-600 font-normal;
  }

  .nav-tabs .nav-item:not(:disabled):hover,
  .nav-tabs .nav-item:not(.disabled):hover,
  .nav-tabs .nav-item.active {
    @apply border-gray-300 border-x border-t rounded-t-md border-b-transparent bg-white;
  }

  .nav-tabs .nav-item.disabled,
  .nav-tabs .nav-item:disabled {
    @apply hover:border-x-transparent hover:border-t-transparent text-gray-400;
  }

  /* tabs alt */
  .nav-tabs-alt .nav-item {
    @apply no-underline text-gray-500 flex justify-center items-center gap-2
    border-b-4 border-transparent px-4 py-3 transition duration-300
    hover:text-primary-500 hover:border-b-primary-500
    cursor-pointer;
  }

  .nav-tabs-alt .nav-item.active {
    @apply text-primary-500 border-b-primary-500;
  }

  .nav-tabs-alt .nav-item.disabled,
  .nav-tabs-alt .nav-item:disabled {
    @apply border-transparent;
  }

  /* pills */
  .nav-pills .nav-item {
    @apply rounded-md;
  }

  .nav-pills-rounded .nav-item {
    @apply rounded-full;
  }

  .nav-pills .nav-item:hover,
  .nav-pills .nav-item.active {
    @apply bg-primary-500 text-white;
  }

  .nav-pills.nav-border .nav-item.active {
    @apply border-primary-500;
  }

  .nav-pills.nav-border .nav-item {
    @apply border border-gray-400 hover:bg-primary-500 hover:text-white hover:border-primary-500 transition duration-300;
  }

  .nav-pills.nav-border .nav-item.disabled,
  .nav-pills.nav-border .nav-item:disabled {
    @apply border border-gray-200 hover:bg-white hover:text-gray-400 hover:border-gray-200;
  }

  /* disabled */
  .nav-item:disabled,
  .nav-item.disabled {
    @apply text-gray-400 hover:text-gray-400 cursor-not-allowed;
  }

  /* nav links */
  .nav-links .nav-item:not(:disabled),
  .nav-links .nav-item:not(.disabled) {
    @apply hover:underline px-2;
  }
}
@layer components {
  .breadcrumb {
    @apply flex gap-2 items-center flex-wrap;
  }

  .breadcrumb-item {
    @apply text-primary-500 hover:text-primary-600 hover:underline;
  }

  .breadcrumb-item.active {
    @apply text-gray-500 hover:no-underline;
  }

  .breadcrumb-divider {
    @apply text-gray-500 text-sm;
  }

  /* underline variant */
  .breadcrumb.breadcrumb-underline .breadcrumb-item {
    @apply underline;
  }

  .breadcrumb.breadcrumb-underline .breadcrumb-item.active {
    @apply text-gray-500 no-underline hover:no-underline;
  }
}
@layer components {
  .accordion {
    @apply flex flex-col border rounded;
  }

  .accordion-item {
    @apply flex flex-col;
  }

  .accordion-header {
    @apply border-b;
  }

  .accordion-header button {
    @apply appearance-none flex gap-2 justify-between items-center py-2 px-4 w-full;
  }

  .accordion-body {
    @apply py-2 px-4 hidden;
  }

  .accordion-item .accordion-header-icon {
    @apply transition duration-300;
  }

  .accordion-item:last-child .accordion-body,
  .accordion-item:last-of-type .accordion-body {
    @apply border-b-0;
  }

  /* open */
  .accordion-item.open .accordion-body,
  .accordion-body.show {
    @apply block border-b;
  }

  .accordion-item.open .accordion-header-icon {
    @apply rotate-180;
  }

  .accordion-item.open .accordion-header {
    @apply bg-primary-100 text-primary-500;
  }

  /* flush */
  .accordion.accordion-flush {
    @apply border-none;
  }

  .accordion.accordion-flush .accordion-item:last-child .accordion-header {
    @apply border-b-0;
  }

  .collapse:not(.show) {
    @apply hidden;
  }

  .collapsing {
    height: 0;
    overflow: 'hidden';
    transition: 'height 0.35s ease';
  }
}
@layer components {
  .dropdown {
    @apply relative inline w-auto;
  }

  .dropdown li,
  .dropdown-menu li {
    @apply p-0 m-0;
  }

  .dropdown-menu {
    @apply bg-white border border-gray-300 rounded-md absolute z-20 min-w-[14rem] max-w-fit p-1 hidden list-none;
  }

  .dropdown-menu.open,
  .dropdown-menu.show {
    @apply block;
  }

  .dropdown-item {
    @apply px-3 py-2 text-gray-600 hover:no-underline hover:bg-gray-100 hover:text-gray-600
      flex gap-2 w-full transition duration-300 cursor-pointer no-underline
      active:bg-primary-500 active:text-white rounded-md list-none;
  }

  .dropdown-item.active {
    @apply bg-primary-500 text-white;
  }

  .dropdown-divider {
    @apply border-b h-1 my-px;
  }

  .dropdown.dropdown-dense .dropdown-item {
    @apply py-1;
  }

  .dropdown.dropdown-sm .dropdown-item {
    @apply text-sm;
  }

  .dropdown-menu.dropdown-menu-right,
  .dropdown-menu.dropdown-menu-end {
    @apply right-0;
  }

  .dropdown.dropdown-hover .dropdown-menu {
    @apply hidden;
  }
}
@layer components {
  .badge {
    @apply px-2 py-1 rounded text-sm;
  }

  /* variants */
  .badge-default {
    @apply bg-gray-100;
  }

  .badge-primary {
    @apply bg-primary-500 text-white;
  }

  .badge-secondary {
    @apply bg-secondary-500 text-white;
  }

  .badge-info {
    @apply bg-info-500 text-white;
  }

  .badge-warning {
    @apply bg-warning-500 text-white;
  }

  .badge-success {
    @apply bg-success-500 text-white;
  }

  .badge-error {
    @apply bg-error-500 text-white;
  }

  .badge-dark {
    @apply bg-gray-800 text-white;
  }

  /* rounded */
  .badge-rounded {
    @apply rounded-full;
  }

  /* circle */
  .badge-circle {
    @apply w-4 h-4 rounded-full !p-0;
  }

  /* button */
  .btn .badge {
    @apply px-3;
  }

  /* heading */
  h1 .badge {
    @apply text-4xl;
  }
  h2 .badge {
    @apply text-3xl;
  }
  h3 .badge {
    @apply text-2xl;
  }
  h4 .badge {
    @apply text-xl;
  }
  h5 .badge {
    @apply text-lg;
  }
  h6 .badge {
    @apply text-base;
  }
}
@layer components {
  .btn-group {
    @apply flex;
  }

  .btn-group > .btn {
    @apply rounded-none;
  }

  .btn-group:not(.btn-group-vertical) > .btn:first-of-type {
    @apply rounded-l-md;
  }

  .btn-group:not(.btn-group-vertical) > .btn:last-of-type {
    @apply rounded-r-md;
  }

  /* border */
  .btn-group:not(.btn-group-vertical) .btn:not(:first-of-type) {
    @apply -ml-[1px];
  }

  /* checkbox & radio */
  .btn-group .btn-check {
    @apply appearance-none hidden;
  }

  .btn-group .btn-check:checked + .btn.btn-primary {
    @apply bg-primary-600 border-primary-600 text-white;
  }

  .btn-group .btn-check:checked + .btn.btn-secondary {
    @apply bg-secondary-600 border-secondary-600 text-white;
  }

  .btn-group .btn-check:checked + .btn.btn-info {
    @apply bg-info-600 border-info-600 text-white;
  }

  .btn-group .btn-check:checked + .btn.btn-warning {
    @apply bg-warning-600 border-warning-600 text-white;
  }

  .btn-group .btn-check:checked + .btn.btn-success {
    @apply bg-success-600 border-success-600 text-white;
  }

  .btn-group .btn-check:checked + .btn.btn-error {
    @apply bg-error-600 border-error-600 text-white;
  }

  .btn-group .btn-check:checked + .btn.btn-dark {
    @apply bg-gray-800 border-gray-800 text-white;
  }

  /* toolbar */
  .btn-toolbar {
    @apply flex gap-2;
  }

  /* nesting */
  .btn-group:not(.btn-group-vertical) > .btn-group:not(:last-child) > .btn,
  .btn-group:not(.btn-group-vertical)
    > .btn:not(:last-child):not(.dropdown-toggle) {
    @apply rounded-r-none;
  }

